import React from "react";
import {
  HeaderContainer,
  Title1,
  AddBtn,
  AddBtnImg,
  SubText,
} from "../Style/ComponentStyle/HeaderStyle";
import { Link } from "react-router-dom";

export default function Header({ title }) {
  return (
    <>
      <HeaderContainer>
        <Title1>{title}</Title1>
        <AddBtn>
          <Link to="/add">
            <AddBtnImg src="img/add_btn.svg" alt="게시글 추가 버튼" />
          </Link>
        </AddBtn>
      </HeaderContainer>
      <SubText>자정이 지나면 달성한 할 일들이 초기화 돼요!</SubText>
    </>
  );
}
